import React from "react";
import styled from "styled-components";

const Container = styled.div``;
const Wrapper = styled.div``;
const Title = styled.div``;
const Form = styled.div``;
const Input = styled.div``;
const Agreement = styled.div``;

const Register = () => {
  return <Container>
    <Wrapper>
        <Title>CREATE AN ACCOUNT</Title>
        <Form>
            <Input placeholder="name"/>
            <Input placeholder="last name"/>
            <Input placeholder="username"/>
            <Input placeholder="email"/>
            <Input placeholder="password"/>
            <Input placeholder="confirm password"/>
            <Agreement>
                Lorem ipsum dolor sit amet, consectetur adipisicing elit. Sapiente veniam esse dolorum cupiditate quod sint est fugiat, itaque delectus vitae dolores debitis. Temporibus fugiat culpa commodi quam eius, amet iste.15
            </Agreement>
        </Form>
    </Wrapper>
  </Container>;
};

export default Register;
